str_splits = split(str_all_6,"\n")



for str_i in str_splits

    ic = find( x -> x==':' , str_i)
    sa = str_i[1:ic[1]-1]

    #sa = replace(sa,"(","[")
    #sa = replace(sa,")","]")

    sxc = matchall(r"\(.+\)",sa)
    sxca = String(sxc[1])
    sxca_s = split(sxca[2:length(sxca)-1],",")

    idx_c = find( x -> x=='(' , String(sa))
    sa_s = sa[1:idx_c[1]-1]
    print("$(sa_s)[")
    for zi in 1:length(sxca_s)
        print( (parse(Int64,String(sxca_s[zi]))+1) )
        print( zi==length(sxca_s) ? "" : ",")
    end
    print("] {\n")

    sb = str_i[ic[1]+1:length(str_i)]

    mms = matchall(r"{.+?}",sb)
    for mi in mms
        mia= match(r"\(\d\)",mi)
        mia1 = replace(mia.match,"(","");
        mia1 = replace(mia1,")","");
        mass_i = parse(Int64,mia1)
        idx_a = find(x -> x==':',mi)
        idx_b = find(x -> x=='}',mi)

        n_mi = mi[(idx_a[1]+1):(idx_b[1]-1)]
        print("M=$(mass_i) : $(n_mi)\n")
    end
    print("}\n")
end
